import React, { Component } from 'react';
import '../../SCSS/nav.scss'
import ngeLogo from '../Images/nge.png'
class nav extends Component {

    constructor(props){
        super(props)

    }


    render() {
        return (
            <div id="navContainer">
                <img src={ngeLogo} id="ngeLogo" />
            </div>
        );
    }
}

export default nav;
